import React, { Component } from "react";
import "../../scss/_index_description1.scss";

class Index_description1 extends Component {
  render() {
    return (
      <div>
        <div className="opis1">
          Pesmi Glasba Besedila Akordi za kitaro aktualnih ansamblov, bandov,
          glasbenikov, pevcev. Glasbeni portal smo izdelali tako da lahko
          istočasno gledate videospot in spremljate besedilo, akorde in
          tablaturo vaše prilubljene skladbe. Vljudno vas vabimo, da tudi vi
          objavite svoje priljubjene pesmi z akori in besedilom.
        </div>
      </div>
    );
  }
}

export default Index_description1;
